INSERT IGNORE INTO sys_core_resource_item (`id`, `name`, `resouce_id`, `pre_code`, `query_sql`, `path`, `parent_id`, `column_name`, `query_table_name`, `object_table_name`, `object_column_name`, `identify_column_name`, `identify_column_label`, `choose_dialog_url`, `create_time`, `create_by`, `update_time`, `update_by`) VALUES ('4157c47a563c4376b5bba176674ce856', '芯片厂商名称', '848200809b364615923f45c661a5255a', 'D', 'select un.id as id, un.name as 名称, un.nick_name as 简称, un.address as 地址 from sys_unit un where un.is_delete=0 ', '/ad1a40f5100d47c8a5b305ce8e770b70/4157c47a563c4376b5bba176674ce856/', 'ad1a40f5100d47c8a5b305ce8e770b70', 'unit_id', 'sys_encryption_chip_model', 'sys_unit', 'id', 'name', ' 名称', '', '2019-07-22 12:17:58', 'admin', NULL, NULL);
INSERT IGNORE INTO sys_core_resource_item (`id`, `name`, `resouce_id`, `pre_code`, `query_sql`, `path`, `parent_id`, `column_name`, `query_table_name`, `object_table_name`, `object_column_name`, `identify_column_name`, `identify_column_label`, `choose_dialog_url`, `create_time`, `create_by`, `update_time`, `update_by`) VALUES ('5b3c6ff8209c4ffe80bb53fbd91ac4a6', '防篡改信息备案状态', '848200809b364615923f45c661a5255a', 'B', 'select st.id as id, st.name as 名称, st.group_name as 组名 from view_dict_filing_status st where 1=1 order by st.id asc', '/5b3c6ff8209c4ffe80bb53fbd91ac4a6/', '', 'filing_status', 'sys_encryption_chip', 'view_dict_filing_status', 'id', 'name', '名称', '', '2019-07-22 11:16:18', 'admin', NULL, NULL);
INSERT IGNORE INTO sys_core_resource_item (`id`, `name`, `resouce_id`, `pre_code`, `query_sql`, `path`, `parent_id`, `column_name`, `query_table_name`, `object_table_name`, `object_column_name`, `identify_column_name`, `identify_column_label`, `choose_dialog_url`, `create_time`, `create_by`, `update_time`, `update_by`) VALUES ('63b37c0a30c34d81809698f344593958', '终端芯片', '848200809b364615923f45c661a5255a', 'A', 'select ec.id as id ,ec.identification_id as 安全芯片标识ID ,vdf.name as 防篡改信息备案状态 ,ecm.name as 芯片型号, su.name as 芯片厂商名称 ,vdp.name as 私钥灌装状态 ,ec.term_public_key as 终端公钥 from sys_encryption_chip ec  left join sys_encryption_chip_model ecm on ecm.id = ec.chip_model_id left join sys_unit su on ecm.unit_id = su.id   left join view_dict_filing_status vdf on vdf.id=ec.filing_status left join view_dict_private_key_filing_status vdp on vdp.id=ec.private_key_status where 1=1  ', '/63b37c0a30c34d81809698f344593958/', '', 'id', 'sys_encryption_chip', 'sys_encryption_chip', 'id', 'identification_id', '安全芯片标识ID', '', '2019-07-22 09:53:28', 'admin', '2019-07-24 17:50:07', 'admin');
